import React, { useState } from 'react';
import Axios from 'axios';
function ApplicantForm()
{
    const url="http://127.0.0.1:8000/api/apply/";
    const [data,setData]=useState({

        Name:"",
    FName:"Sar",
    Gender:"Male",
    DOB:"2002-04-04",
    Age:"18",
    Category:"ABC",


    Ward:"EKV",
    SubDistrict:"Erode",
    District:"Erode",
    State:"Tamilnadu",

    Pincode:"123456", 

    Mobile:"9087654321",
    AadharNo:"123456789012",
    Disablity:"No",
    DisabilityType:"None",
    BPL_Family_ID:"ded",
    BankDetails:"Nothin",
    IGNOAPS:"Yes",
    IGNWPS:"Yes",
    IGNDPS:"Yes",
    NFBS:"Yes"
    })

    const AddDetails=async()=>{
        console.log(data);
      await Axios({
            method:'post',
            url:url,
            data:data
         }).then(res=>{
             console.log(res.data);
         });
    }
    function submit(e)
    {
        e.preventDefault();

        Axios.post(url,{
            Name:data.Name,
            FName:data.FName,
            Gender:data.Gender,
            DOB:data.DOB,
            Age:data.Age,
            Category:data.Category,
            Ward:data.Ward,
            SubDistrict:data.SubDistrict,
            District:data.District,
            State:data.State,
            Pincode:data.Pincode,
            Mobile:data.Mobile,
            AadharNo:data.AadharNo,
            Disablity:data.Disablity,
            DisabilityType:data.DisabilityType,
            BPL_Family_ID:data.BPL_Family_ID,
            BankDetails:data.BankDetails,
            IGNOAPS:data.IGNOAPS,
            IGNWPS:data.IGNWPS,
            IGNDPS:data.IGNDPS,
            NFBS:data.NFBS

        }).then(res=>{
            console.log(res.data);
        })
    }

    function handle(e)
    {
      const newdata=(...data)=>
      newdata[e.target.id]=e.target.value
      setData(newdata)
      console.log(newdata)
    }
    return(
        <div>
          <form>
          <input  onChange={(e) => handle(e)} id="Name" value={data.Name} placeholder='Name' type="text"></input>
                <input onChange={(e) => handle(e)} id="Fname" value={data.FName} placeholder='Fname' type='text'></input>
                <input onChange={(e) => handle(e)} id="Gender" value={data.Gender} placeholder='Gender' type='text'></input>
                <input onChange={(e) => handle(e)} id="DOB'" value={data.DOB} placeholder='DOB' type='text'></input>
                <input onChange={(e) => handle(e)} id="Age" value={data.Age} placeholder='Age' type='number'></input>
                <input onChange={(e) => handle(e)} id="Category" value={data.Category} placeholder='Category' type='text'></input>
                <input onChange={(e) => handle(e)} id="Ward" value={data.Ward} placeholder='Ward' type='text'></input>
                <input onChange={(e) => handle(e)} id="SubDistrict" value={data.SubDistrict} placeholder='SubDistrict' type='text'></input>
                <input onChange={(e) => handle(e)} id="District" value={data.District} placeholder='District' type='text'></input>
                <input onChange={(e) => handle(e)} id="State" value={data.State} placeholder='State' type='text'></input>
                <input onChange={(e) => handle(e)} id="Pincode" value={data.Pincode} placeholder='Pincode' type='number'></input>
                <input onChange={(e) => handle(e)} id="Mobile" value={data.Mobile} placeholder='Mobile' type='number'></input>
                <input onChange={(e) => handle(e)} id="AadharNo" value={data.AadharNo} placeholder='AadharNo' type='number'></input>
                <input onChange={(e) => handle(e)} id="Disability" value={data.Disablity} placeholder='Disability' type='text'></input>
                <input onChange={(e) => handle(e)} id="DisabilityType" value={data.DisabilityType} placeholder='DisabilityType' type='text'></input>
                <input onChange={(e) => handle(e)} id="BPL_Family_ID" value={data.BPL_Family_ID} placeholder='BPL_Family_ID' type='text'></input>
                <input onChange={(e) => handle(e)} id="BankDetails" value={data.BankDetails} placeholder='BankDetails' type='text'></input>
                <input onChange={(e) => handle(e)} id="IGNOAPS" value={data.IGNOAPS} placeholder='IGNOAPS' type='text'></input>
                <input onChange={(e) => handle(e)} id="IGNWPS" value={data.IGNWPS} placeholder='IGNWPS' type='text'></input>
                <input onChange={(e) => handle(e)} id="IGNDPS" value={data.IGNDPS} placeholder='IGNDPS' type='text'></input>
                <input onChange={(e) => handle(e)} id="NFBS" value={data.NFBS} placeholder='NFBS' type='text'></input>
          </form>





    </div>);

}
export default ApplicantForm;
